import { ADD_GOOD, DELETE_GOOD } from "../constants";

export const addGood = (id, name, description) => ({
  type: ADD_GOOD,
  id,
  name,
  description
});

export const deleteGood = (id, name, description) => ({
  type: DELETE_GOOD,
  id,
  name,
  description
});
